//# sourceMappingURL=bootstrap.min.js.map
$(document).ready(function() {
  // array of filter for type attributes
  var typeAttributeList = [];

  // array of filter for space attributes
  var spaceAttributeList = [];

  // array of filter for application attributes
  var applicationAttributeList = [];

  // array of filter for color attributes
  var colorAttributeList = [];

  /* Banner Animation JS */
  $('.section-hero__con-col').mouseenter(function() {
    $('.section-hero__con-col').addClass('hover-off');
    $(this).removeClass('hover-off');
    $(this).addClass('hover-on');
    var tabID = $(this).data('content');
    $('.section-hero__col').each(function() {
      var bgID = $(this).data('bg');
      if (bgID == tabID) {
        $(this).addClass('active');
        var bg_link = $(this).data('bgsrc');
        $(this).css('background-image', 'url(' + bg_link + ')');
      }
    });
  });

  $('.section-hero__con-col').mouseleave(function() {
    $('.section-hero__con-col').removeClass('hover-off');
    $(this).removeClass('hover-on');
    $('.section-hero__col').removeClass('active');
    $('.section-hero__col').css('background-image', 'none');
  });

  $('.section-hero__col').mouseleave(function() {
    var colObj = this;
    setTimeout(function() {
      $(colObj).removeClass('active');
    }, 490);
  });
  /* End of Banner Animation JS */

  /* Video Popup JS */
  $('.mn-video-pop-btn').magnificPopup({
    type: 'iframe',
    mainClass: 'mfp-fade',
    removalDelay: 160,
    preloader: false,
    fixedContentPos: false
  });
  /* End of Video Popup JS */

  /* CheckBox JS */
  $('.mn-custom-checkbox .form-check-input').change(function() {
    if ($(this).is(':checked')) {
      $(this).parents('.mn-custom-checkbox').addClass('active');
    } else {
      $(this).parents('.mn-custom-checkbox').removeClass('active');
    }
  });
  /* End of CheckBox JS */

  /* Product Category Filter JS */
  $('#open-filter').click(function(e) {
    $('#product-sidebar').toggleClass('translate-y-full');
  });

  /* Product Category Filter JS */
  $('#close-filter').click(function(e) {
    $('#product-sidebar').toggleClass('translate-y-full');
    $(this).text($(this).text() == 'Apply' ? 'Filter' : 'Apply');
  });

 $('.toggleSubMenu').on('click', function() {
   var target = $(this).attr('aria-controls');
   $('#' + target).slideToggle('fast', function() {
     var isHidden = $(this).is(':hidden');
     $(this).attr('hidden', isHidden);
   });
   var isExpanded = $(this).attr('aria-expanded') === 'true';
   $(this).attr('aria-expanded', !isExpanded);
 });



  /**
   * Add sticky for product sidebar
   */
  function fixSidebar() {
    var screenSize = $(window).width();
    if (screenSize > 991) {
      $('.section-product__sidebar-wrap').stickySidebar({
        topSpacing: 60,
        resizeSensor: true
      });
    }
  }
  fixSidebar();
  /* End of Product Category Filter JS */

  var container = $('.section-product-list__masonry');
  container.imagesLoaded(function() {
    container.masonry({
      // options
      itemSelector: '.section-product-list__masonry-item',
      columnWidth: 3,
      gutterWidth: 0
    });
  });

  /* Trigered when individual attribute clear is clicled */
  $(document).on('click', '.remove-filter', function(e) {
    e.preventDefault();
    var attributeType = $(this).attr('name');
    var value = $(this).data('value');
    var ajaxurl = $('.project-posts-container').data('url');

    switch (attributeType) {
      case 'type':
        typeAttributeList.remove(value);
        break;
      case 'space':
        spaceAttributeList.remove(value);
        break;
      case 'application':
        applicationAttributeList.remove(value);
        break;
      case 'color':
        colorAttributeList.remove(value);
        break;
      default:
        break;
    }

    $.ajax({
      url: ajaxurl,
      type: 'post',
      data: {
        typeAttributeList: typeAttributeList,
        spaceAttributeList: spaceAttributeList,
        applicationAttributeList: applicationAttributeList,
        colorAttributeList: colorAttributeList,
        action: 'project_filter'
      },
      error: function(e) {
        console.log(e);
      },
      success: function(response) {
        $('.project-posts-container').empty();
        $('#' + value).prop("checked", false);
        checkRemoveLoadMore(response);
        removeAttributeFromFilter(value);
      }
    });
  });
  /* End of function */

  /* Called to hide clear all button when no attributes is in filter list */
  function removeAttributeFromFilter(value) {
    $('.list-inline-item.' + value).remove();
    if ($('.project-filter-list').children().length == 0) {
      $('.clear-all-container').hide();
    }
  }
  /* End of function */

  /* Called to show/hide Loadmore button  */
  function checkRemoveLoadMore(response) {
    $('.project-posts-container').append(response).masonry('reloadItems').masonry('layout');
    var page = $('.project-posts-container .project-post:last-child').data('page');
    var maxPageNumber = $('.project-posts-container .project-post:last-child').data('maxpage');

    if (page == maxPageNumber) {
      $('.load-more-container').hide();
    } else if (maxPageNumber > page) {
      $('.load-more-container').show();
    }
  }

  if (window.location.href.indexOf('/product-category/') > -1) {
    var pageLink = $(document).find('#products_page_link').val();
    $('.mn-custom-checkbox .form-check-input').click(function() {
      window.history.pushState(null, null, pageLink);
      $('.section-product-list__heading').html('All Products');
      $('.product-cat__banner').hide();
    });
    $('.section-product__sidebar-filter-clear').click(function() {
      window.history.pushState(null, null, pageLink);
      $('.section-product-list__heading').html('All Products');
      $('.product-cat__banner').hide();
    });
  }
  /* End of function */

  /* Announcement Bar */
  $(document).on('click', '.mn-announcement__close', function() {
    setCookie('hide-announcement', 'yes', 2);
  });

  /* Set Cookie to hide announcement */
  function setCookie(cname, cvalue, hr) {
    var expires = '';
    var date = new Date();
    date.setTime(date.getTime() + (hr * 60 * 60 * 1000));
    expires = '; expires=' + date.toUTCString();
    document.cookie = cname + '=' + (cvalue || '')  + expires + '; path=/';
    $('.mn-announcement').hide();
  }

  /* Get Cookie to hide announcement */
  function getCookie(name) {
    var nameEQ = name + '=';
    var ca = document.cookie.split(';');
    for(var i=0;i < ca.length;i++) {
      var c = ca[i];
      while (c.charAt(0)==' ') c = c.substring(1,c.length);
      if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length,c.length);
    }
    return null;
  }

  /* check cookie */
  var CookieGet = getCookie('hide-announcement');
  if (CookieGet == 'yes') {
    $('.mn-announcement').hide();
  }

  setTimeout(()=>{
    $('.mn-announcement').hide();
  }, 3000);

  $(document).on('click', '.mn-footer__menu-item', function(e) {
    e.preventDefault();
    $(window).scrollTop(0);
    let href = $(this).find('a').attr('href');
    $('.mn-header__toggle').trigger('click');
    $('.nav_filter_step').find('a[href=' + href +']').trigger('click');
  });
});

$(document).ready(function() {
  if ($('.section-gallery-page').length) {
    register_vars.current_page = 2;
    /* Triggered when Load More Button is clicked */
    let all_selected_filter = [];

    $('.section-gallery-page__form-check .mn-custom-checkbox .form-check-input').change(function() {
      let option_value = $(this).val();
      register_vars.current_page = 1;
      if ($(this).is(':checked')) {
        if ($.inArray(option_value, all_selected_filter) == -1) {
          all_selected_filter.push(option_value);
        }
      } else {
        if ($.inArray(option_value, all_selected_filter) != -1) {
          all_selected_filter = $.grep(all_selected_filter, function(value) {
            return value != option_value;
          });
        }
      }
      $('.gallery-list-container').html('');
      gallery_refresh(all_selected_filter.toString());
    });

    $('.gallery__tab-clearall .gallery-filter-clear').on('click', function(e) {
      e.preventDefault();
      all_selected_filter.length = 0;
      $('.gallery-list-container').html('');
      $('.mn-custom-checkbox').removeClass('active');
      $('.form-check-input').prop('checked', false);
      register_vars.current_page = 1;
      gallery_refresh('');
    });

    $(document).on('click', '.gallery-load-more', function(e) {
      e.preventDefault();
      let max_page = $('.section-gallery-list__masonry-item').last().data('maxpage');
      if (register_vars.current_page <= max_page) {
        gallery_refresh(all_selected_filter.toString());
      } else {
        $('.section-gallery-list__load-more').hide();
      }
    });

    /**
    * Ajax function to refresh lisf of gallery item
    * @returns void
    */
    function gallery_refresh(data_query) {
      $.ajax({
        url: register_vars.ajax_url,
        type: 'post',
        data: {
          page: register_vars.current_page,
          action: register_vars.gallery_refresh,
          gallery_option: data_query,
        },
        success: function(response) {
          let $response = $(response);
          $('.gallery-load-more').prop('disabled', false);
          if (response == '') {
            register_vars.current_page = 1;
            $('.gallery-list-container').html('<p class="gallery_no_result">Appears there are no results for the combination of filters you have selected. Try reducing the number of selections</p>');
            $('.section-gallery-list__load-more').hide();
          } else {
            $('.gallery_no_result').html('');
            $('.gallery-list-container').append($response).masonry('appended', $response);
            $('.gallery-list-container').imagesLoaded().progress(function() {
              $('.gallery-list-container').masonry('layout');
            });
            let max_page = $('.section-gallery-list__masonry-item').last().data('maxpage');
            if (register_vars.current_page >= max_page) {
              $('.gallery-load-more').prop('disabled', true);
              $('.section-gallery-list__load-more').hide();
            } else {
              $('.section-gallery-list__load-more').show();
              $('.gallery-load-more').prop('disabled', false);
              register_vars.current_page++;
            }
          }
        }
      });
    }

    if ($('.gallery-load-more').length) {
      $(window).on('scroll', function() {
        if ($(window).scrollTop() > ($('.gallery-load-more').offset().top) - $(window).height()) {
          if ($('.gallery-load-more').is(':visible')) {
            $('.gallery-load-more').trigger('click');
            $('.gallery-load-more').prop('disabled', true);
          }
        }
      });
    }

    //Add lightbox for existing elements and on load more
    galleryLightbox();
    $('body').on('DOMNodeInserted', '.section-gallery-list__masonry-item', function(e) {
      galleryLightbox();
    });
  }

  /* Gallery Image Popup JS */
  function galleryLightbox() {
    $('.section-gallery-list__masonry-item ').magnificPopup({
      type: 'image',
      delegate: '.mn-product-pop-btn',
      mainClass: 'mfp-img-mobile',
      gallery: {
        enabled: true,
        navigateByImgClick: true,
        preload: [0,1] // Will preload 0 - before current, and 1 after the current image
      }
    });
    /* End of Gallery Image Popup JS */
  }

  $('.main-carousel').flickity({
    // options
    cellAlign: 'left',
    contain: true
  });
});
$(document).ready(function() {
  /* Navigation  JS */
  $('.mn-header__toggle').on('click', function (e) {
    e.preventDefault();
    $('body').toggleClass('mega-menu-open');
    $(this).toggleClass('mn-header__toggle-close');
  });

  $('#openMenuButton').on('click', function (e) {
    e.preventDefault();
    $('body').toggleClass('overflow-hidden');
    $('#mobileMenu').toggleClass('-translate-y-full');
  });

  $('#closeMenuButton').on('click', function (e) {
    e.preventDefault();
    $('body').toggleClass('overflow-hidden');
    $('#mobileMenu').toggleClass('-translate-y-full');
  });

  headerClass();

  /* Assign class and background image based on window width */
  function headerClass()
  {
    var curWidth = $(window).width();
    if (curWidth < 992) {
      $('.mn-header').addClass('mn-header--white');
      $('.section-hero__con-col').each(function () {
        var mobBg = $(this).data('mobilebg');
        $(this).css('background-image', 'url(' + mobBg + ')');
      });
    }
    else {
      $('.mn-header').removeClass('mn-header--white');
      $('.section-hero__con-col').css('background-image', 'none');
    }
  }
  /* End of function */
  $(window).resize(function() {
    headerClass();
  });

  //Toggle search window
  $('.mn-header__search').on('click', function (e) {
    e.preventDefault();
    $('body').toggleClass('search-open');
    setTimeout(function() {
      $(document).find('.mn-header__search-box').focus();
    }, '800');
    $(this).parents('.mn-header--home').toggleClass('mn-header--white');
    $('.mn-header__search-close').hide();

    if ($('body').hasClass('search-open')) {
      $('html, body').addClass('overflow-hidden');
    } else {
      $('html, body').removeClass('overflow-hidden');
    }
  });
  /* End of Navigation  JS */

  /* Live Search */

  //Hide previous search when there is no result
  $('.mns__previous_search').hide();

  //Disable form submission
  $('.mn-header__search-form').on('submit', function(e) {
    e.preventDefault();
  });

  //Append search result and previous search query
  var searchInterval  = 1500,
      searchTimer;
  $('.mn-header__search-box').on('keyup', function(e) {
      e.preventDefault();
      $('.loading_gif').css('display', 'block');
      clearTimeout(searchTimer);

      searchTimer = setTimeout(function() {
          $('.mn-header__search-close').show();
          liveSearch();
          $('.previous_search_list').append('\
          <li class="leading-tight mb-2 section-product__sidebar-filter-content-list-item list-inline-item previous_search_saved">\
            <a href="#" class="flex items-center gap-2 previous_search">\
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" class="w-5 h-5">\
                <path fill-rule="evenodd" d="M7.21 14.77a.75.75 0 01.02-1.06L11.168 10 7.23 6.29a.75.75 0 111.04-1.08l4.5 4.25a.75.75 0 010 1.08l-4.5 4.25a.75.75 0 01-1.06-.02z" clip-rule="evenodd" />\
              </svg>\
              <span class="saved_keyword">' + $('.mn-header__search-box').val() + '</span>\
            </a>\
          </li>');
      }, searchInterval);
  });

  //Trigger AJAX on previous search result click
  $('body').on('click', '.previous_search_saved', function(e) {
    e.preventDefault();
    $('.mn-header__search-box').val($(this).find('a .saved_keyword').text());
    liveSearch();
  });

  /**
   * Append search results ajax
   * @return boolean
   */
  function liveSearch()
  {
    var keyword = $('.mn-header__search-box').val();

    $.ajax({
      url: register_vars.ajax_url,
      type: 'post',
      data: {
        page: register_vars.current_page,
        action: register_vars.live_search,
        query: keyword,
      },
      success: function(response) {
        $('.mns__previous_search').show();
        $('.loading_gif').hide();
        $('.mn-header__search-results_list').html('');
        $('.mn-header__search-results_list').append(response);
        return true;
      }
    });
  }

  //Clear search result on close button click
  $('.mn-header__search-close').on('click', function() {
    $('.mn-header__search-box').val('');
    $('.mn-header__search-results_list').html('');
  });
  /* End of Live Search */
});
$(document).ready(function() {

  /*
   *   This content is licensed according to the W3C Software License at
   *   https://www.w3.org/Consortium/Legal/2015/copyright-software-and-document
   *
   *   Simple accordion pattern example
   */

  'use strict';

  class Accordion {
    constructor(domNode) {
      this.rootEl = domNode;
      this.buttonEl = this.rootEl.querySelector('button[aria-expanded]');

      const controlsId = this.buttonEl.getAttribute('aria-controls');
      this.contentEl = document.getElementById(controlsId);

      this.open = this.buttonEl.getAttribute('aria-expanded') === 'true';

      // add event listeners
      this.buttonEl.addEventListener('click', this.onButtonClick.bind(this));
    }

    onButtonClick() {
      this.toggle(!this.open);
    }

    toggle(open) {
      // don't do anything if the open state doesn't change
      if (open === this.open) {
        return;
      }

      // update the internal state
      this.open = open;

      // handle DOM updates
      this.buttonEl.setAttribute('aria-expanded', `${open}`);
      if (open) {
        this.contentEl.removeAttribute('hidden');
      } else {
        this.contentEl.setAttribute('hidden', '');
      }
    }

    // Add public open and close methods for convenience
    open() {
      this.toggle(true);
    }

    close() {
      this.toggle(false);
    }
  }

  // init accordions
  const accordions = document.querySelectorAll('.accordion .accordion-trigger');
  accordions.forEach((accordionEl) => {
    new Accordion(accordionEl);
  });


  /*
   *   This content is licensed according to the W3C Software License at
   *   https://www.w3.org/Consortium/Legal/2015/copyright-software-and-document
   *
   *   File:   tabs-automatic.js
   *
   *   Desc:   Tablist widget that implements ARIA Authoring Practices
   */

  'use strict';

  class TabsAutomatic {
    constructor(groupNode) {
    this.tablistNode = groupNode;

    this.tabs = [];

    this.firstTab = null;
    this.lastTab = null;

    this.tabs = Array.from(this.tablistNode.querySelectorAll('[role=tab]'));
    this.tabpanels = [];

    for (var i = 0; i < this.tabs.length; i += 1) {
      var tab = this.tabs[i];
      var tabpanel = document.getElementById(tab.getAttribute('aria-controls'));

      tab.tabIndex = -1;
      tab.setAttribute('aria-selected', 'false');
      this.tabpanels.push(tabpanel);

      tab.addEventListener('keydown', this.onKeydown.bind(this));
      tab.addEventListener('click', this.onClick.bind(this));


      if (!this.firstTab) {
      this.firstTab = tab;
      }
      this.lastTab = tab;
    }

    this.setSelectedTab(this.firstTab, false);
    }

    setSelectedTab(currentTab, setFocus) {
    if (typeof setFocus !== 'boolean') {
      setFocus = true;
    }
    for (var i = 0; i < this.tabs.length; i += 1) {
      var tab = this.tabs[i];
      var tabPanel = this.tabpanels[i];
      var carousel = tabPanel.querySelector('.main-carousel');

      if (currentTab === tab) {
        var carousel = document.querySelector('.main-carousel');
        var flkty = new Flickity( carousel );
        console.log(carousel);
        tab.setAttribute('aria-selected', 'true');
        tab.removeAttribute('tabindex');
        tab.classList.remove('text-gray-400');
        tab.classList.add('text-black');
        this.tabpanels[i].classList.remove('is-hidden');

        if (carousel) {
          carousel.style.display = 'block';
          var flkty = new Flickity(carousel);
          console.log(flkty);
          flkty.resize();
        }

        if (setFocus) {
          tab.focus();
        }
      } else {
      tab.setAttribute('aria-selected', 'false');
      tab.tabIndex = -1;
      tab.classList.remove('text-black');
      tab.classList.add('text-gray-400');
      this.tabpanels[i].classList.add('is-hidden');
      }
    }
    }

    setSelectedToPreviousTab(currentTab) {
    var index;

    if (currentTab === this.firstTab) {
      this.setSelectedTab(this.lastTab);
    } else {
      index = this.tabs.indexOf(currentTab);
      this.setSelectedTab(this.tabs[index - 1]);
    }
    }

    setSelectedToNextTab(currentTab) {
    var index;

    if (currentTab === this.lastTab) {
      this.setSelectedTab(this.firstTab);
    } else {
      index = this.tabs.indexOf(currentTab);
      this.setSelectedTab(this.tabs[index + 1]);
    }
    }

    /* EVENT HANDLERS */

    onKeydown(event) {
    var tgt = event.currentTarget,
      flag = false;

    switch (event.key) {
      case 'ArrowUp':
      this.setSelectedToPreviousTab(tgt);
      flag = true;
      break;

      case 'ArrowDown':
      this.setSelectedToNextTab(tgt);
      flag = true;
      break;

      case 'Home':
      this.setSelectedTab(this.firstTab);
      flag = true;
      break;

      case 'End':
      this.setSelectedTab(this.lastTab);
      flag = true;
      break;

      default:
      break;
    }

    if (flag) {
      event.stopPropagation();
      event.preventDefault();
    }
    }

    onClick(event) {
    this.setSelectedTab(event.currentTarget);
    }
  }

  // Initialize tablist

  window.addEventListener('load', function () {
    var tablists = document.querySelectorAll('[role=tablist].automatic');
    for (var i = 0; i < tablists.length; i++) {
    new TabsAutomatic(tablists[i]);
    }
  });

  /* Banner Animation JS */
  $('.section-hero__con-col').hover(function() {
    $('.section-hero__con-col').addClass('hover-off');
    $(this).removeClass('hover-off');
    $(this).addClass('hover-on');
    var tabID = $(this).data('content');
    $('.section-hero__col').each(function() {
      var bgID = $(this).data('bg');
      if (bgID == tabID) {
        $(this).addClass('active');
        var bg_link = $(this).data('bgsrc');
        $(this).css('background-image', 'url(' + bg_link + ')');
      }
    });
  }, function() {
    $('.section-hero__con-col').removeClass('hover-off');
    $(this).removeClass('hover-on');
    $('.section-hero__col').removeClass('active');
    $('.section-hero__col').css('background-image', 'none');
  });
  $('.section-hero__col').mouseleave(function() {
    var colObj = this;
    setTimeout(function() {
      $(colObj).removeClass('active');
    }, 490);
  });
  /* End of Banner Animation JS */

  /* Video Popup JS */
  $('.mn-video-pop-btn').magnificPopup({
      type: 'iframe',
      mainClass: 'mfp-fade',
      removalDelay: 160,
      preloader: false,
      fixedContentPos: false
  });
  /* End of Video Popup JS */

  /* Testimonial Slider */
  $('.section-testimonial__slider').slick({
    arrows: false,
    autoplay: true,
    autoplaySpeed: 4000,
    dots: true,
  });
  /* End Testimonial Slider */

  /* Client Slider */
  $('.section-testimonial__client-slider').slick({
    infinite: true,
    margin: 0,
    nav: false,
    dots: false,
    slidesToShow: 7,
    slidesToScroll: 1,
    responsive: [
      {
        breakpoint: 800,
        settings: {
          slidesToShow: 5,
        }
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 3,
        }
      },
      {
        breakpoint: 400,
        settings: {
          slidesToShow: 2,
        }
      },
    ]
  });
  /* End Client Slider */
});



